import React, {Component} from 'react';
import ProfilePage from "../Profile/ProfilePage";
class Profile extends Component{
    render(){
        return(
            <React.Fragment>
                <ProfilePage/>
            </React.Fragment>
        );
    }
}

export default Profile;
